/* Tiddlyshow App 2.1
CSS for thumbnail view
*/


.ts-thumbnails {
    --thumbnail-gap: 50px;
    --thumbnail-ratio: calc(4 / 3); /* you can use (4 / 3) also */
    --thumbnail-width: 1024px;
    --thumbnail-height: calc(var(--thumbnail-width) / var(--thumbnail-ratio));
}


.ts-thumbnails.ts-thumbnails-container {
    padding-top: 25px;
    width: 100%;
    display: flex;
    flex-wrap: wrap;
  /*  background: #585a5e;*/
}

/* Scaling */

.ts-thumbnails.ts-thumbnails-container .ts-thumbnail {
    --thumbnail-scale: 0.25;
    --thumbnail-magic: calc(1 - var(--thumbnail-scale));

    margin-top: 0;
    margin-right:
        calc(
            var(--thumbnail-width) *
            var(--thumbnail-magic) * -1
        );
    margin-bottom:
        calc(
            var(--thumbnail-gap) *
            var(--thumbnail-scale) -
            var(--thumbnail-height) *
            var(--thumbnail-magic)
        );
    margin-left:
        calc(
            var(--thumbnail-gap) *
            var(--thumbnail-scale)
        );
    transform-origin: 0 0;
    transform: scale(var(--thumbnail-scale));
}


.ts-thumbnails.ts-thumbnails-container .ts-thumbnail {
    border-radius: 2px;
    box-shadow: 0 20px 50px rgba(0, 0, 0, 0.3);
}

.th-thumbnails.ts-thumbnails-container .ts-thumbnail * {
    pointer-events: none;
}

.ts-thumbnail {
    position: relative;
    z-index: 0;
    overflow: hidden;
    box-sizing: border-box;
  /*  padding: 81px 100px 0;*/
    padding: 5px 30px;
    width:  var(--thumbnail-width);
    height: var(--thumbnail-height);
    background: #ffffff;
}



/*Responsive*/
@media (min-width: 1174px) {
    .ts-thumbnails.ts-thumbnails-container .ts-thumbnail {
        --thumbnail-scale: 0.40;
    }
}

@media (min-width: 2348px) {
    .ts-thumbnails.ts-thumbnails-container .ts-thumbnail {
        --thumbnail-scale: 1.0;
    }
}

.ts-thumbnail-btn {
    text-align:unset;
}

.ts-thumbnail-number{
    background: gray;
    color: #fff;
    font-size:2em;
    font-weight:600;  
    position:absolute;
    bottom: 10px;
    right: 10px;
    height: 60px;
    width:  60px;
    -webkit-border-radius: 30px;
    -moz-border-radius:    30px;
    border-radius:         30px;
    text-align: center;
    line-height: 60px;
    opacity: 0.95;
}

[data-tags~="thumbnails"] {
  border: 1px solid #0000ff;
  background-color: #edf2ff;
}

